import "./Template.css"
import { FaInstagram } from 'react-icons/fa';

class Template extends Component{
    state={
      visibility_my:false
    };
    handleBoxToggle  = () => {this.setState({visibility_my:!this.state.visibility_my})
    console.log(this.state.visibility_my)
    };

    render() {
        let visibility = "hide";

        if(this.state.visibility_my){
            visibility = "show";
        }
        return(
                <div onMouseEnter={this.handleBoxToggle}>
                        <div className="container" >
                            <img src={this.props.image} alt={"kek"} className="image"/>
                            <div className="overlay" >
                                <a href={this.props.my_key} className="icon" title="instagram">
                                    <i className={'fa fa-instagram ' +visibility}/>
                                </a>
                            </div>
                        </div>
                </div>
        )}
}
export default Template;
